feature.on('click',e=>{


  let platform = parcel.getFeatureById('sunStone');
  let anim = platform.createAnimation('position');
  let buttonColor = feature.get('color');
  let upstairsButton = parcel.getFeatureById('upstairsButton');

  console.log("color:  ", buttonColor);


  if (buttonColor == 'green')
  {
      // button was green
      feature.set({color:'red'});


      anim.setKeys(
        [{
            frame: 0,
            value: platform.position.add(new Vector3(0, 0, 0) )
          }
          ,
          {
            frame: 320,
            value: platform.position.add(new Vector3(0, -12.5, 0) )
          }        
        ]) 
  }
  else
  {
        // button was red
        feature.set({color:'green'});


        anim.setKeys(
          [{
              frame: 0,
              value: platform.position.add(new Vector3(0, -12.5, 0) )
            }
            ,
            {
              frame: 320,
              value: platform.position.add(new Vector3(0, 0, 0) )
            }        
          ])       
  }


  platform.startAnimations([anim]);



})

